static inline void node_layer_2_MatMul(const float A[1][SECOND_LAYER_SIZE_ROW], 
	const float B[SECOND_LAYER_SIZE_ROW][SECOND_LAYER_SIZE_COL], float Y[1][SECOND_LAYER_SIZE_ROW])
{
	/* MatMul */
	printf("node_layer_2_MatMul\n");
	for (uint32_t r = 0; r < 1; r++)
		for (uint32_t c = 0; c < INPUT_LAYER_SIZE_ROW; c++) {
			Y[r][c] = 0;
			for (uint32_t i = 0; i < INPUT_LAYER_SIZE_COL; i++)
			{
				Y[r][c] += A[r][i] * binarise(B[c][i],1);
				printf("Y[%d][%d]: %f\n", r, c, Y[r][c]);
			}
			
		}
}

