static inline void node_layer_softmax(const float tensor_layer_1_Add_output[1][INPUT_LAYER_SIZE_ROW], float tensor_output[1][INPUT_LAYER_SIZE_ROW])
{
	printf("node_layer_softmax \n");

	float m = -INFINITY;
	for (unsigned i0 = 0; i0 < 1; i0++) {
		for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
			if (tensor_layer_1_Add_output[i0][i1] > m) {
				m = tensor_layer_1_Add_output[i0][i1];
			}
		}
	}

	float sum = 0.0;
	for (unsigned i0 = 0; i0 < 1; i0++) {
		for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
			sum += exp(tensor_layer_1_Add_output[i0][i1] - m);
		}
	}

	float offset = m + log(sum);
	for (unsigned i0 = 0; i0 < 1; i0++) {
		for (unsigned i1 = 0; i1 < INPUT_LAYER_SIZE_ROW; i1++) {
			tensor_output[i0][i1] = exp(tensor_layer_1_Add_output[i0][i1] - offset);
		}
	}
}

static inline float RoughSigmoid(float value)
{
    float x = fabsf(value);
    float x2 = x*x;
    float e = 1.0f + x + x2*0.555f + x2*x2*0.143f;
    return 1.0f / (1.0f + (value > 0 ? 1.0f / e : e));
}


static inline void node_layer_Sigmoid(const float tensor_layer_2_Add_output[1][SECOND_LAYER_SIZE_ROW],
        float tensor_layer_2_Relu_output[1][SECOND_LAYER_SIZE_ROW])
{
        printf("node_layer_2_ReLU \n");
        for (unsigned i0 = 0; i0 < 1; i0++) {
                for (unsigned i1 = 0; i1 < SECOND_LAYER_SIZE_ROW; i1++) {
                        tensor_layer_2_Relu_output[i0][i1] = RoughSigmoid(tensor_layer_2_Add_output[i0][i1]);
                        printf("tensor_layer_2_Relu_output[%d][%d]: %f\n", i0, i1, tensor_layer_2_Relu_output[i0][i1]);
                }
        }
}



